// Ingest data
import org.bdgenomics.adam.io._
import org.apache.hadoop.io.Text

// Read and interlace data
val fr = sc.newAPIHadoopFile(
    "s3n://1000genomes/phase3/data/HG02666/sequence_read/*_1*",
    classOf[SingleFastqInputFormat],
    classOf[Void],
    classOf[Text]
).map(_._2.toString)
val rr = sc.newAPIHadoopFile(
        "s3n://1000genomes/phase3/data/HG02666/sequence_read/*_2*",
        classOf[SingleFastqInputFormat],
        classOf[Void],
        classOf[Text]
).map(_._2.toString)
val data = fr.zip(rr).map { 
    case(fr,rr) => fr+rr.dropRight(1) // Interlace
}

// Make partitions of the data and save to HDFS
data.repartition(14).saveAsTextFile("/notebooks/disk/HG02666")
